import React from 'react'
import { Col, Container, Row } from 'react-bootstrap'

const MyContainer = ({children}) => {
  return (
    <Container>
      <Row>
        <Col >{children}
        </Col>
      </Row>
    </Container>
  )
}

export default MyContainer
